b'https://issues.hibernatingrhinos.com/issue/RavenDB-15032

I added compare exchange per product {key: productId, value: UnitOnStack}
And I created an index by this code
```
private class Products_ByUnitOnStock : AbstractIndexCreationTask<Product>
{
    public class Result
    {
        public int UnitOnStock;
    }

    public Products_ByUnitOnStock()
    {
        Map = employees =>
            from employee in employees
            select new Result {UnitOnStock = LoadCompareExchangeValue<int>(employee.Id)};
    }
}
```'

