b'The following code was not working properly. The reason was the "ShowTimings" property was not being considered when doing queries with dynamic indexes.

```csharp
//var query = session.Query<Order, Orders_ByOrderedAt>()
var query = session.Query<Order>()
    .Statistics(out stats)
    .Customize(q => q.ShowTimings());

var orders = (
        from order in query
        orderby order.OrderedAt
        select order
    )
    .ToList();
```'

b'This can cause the read transaction to read data that started after it opened, so we need to prevent that.

