b'If you do 

```
LoadByUniqueConstraint<Foo>(arrayOfIds);

foreach(var id in arrayOfIds) {
    LoadByUniqueConstraint<Foo>(id);
}
```

You get a request for every Foo that does not exist.  Using a Guid as the "id" in this case is a useful hack that avoids having to line up 2 arrays, but there is no need to generate a new Guid each time.  Instead I've just hardcoded a fixed Guid and we'll use this every time.
'

b"We found in our project that Including other documents via a loaded document's Id property fails silently on the server. Let's say we have the following types:

```
class Customer {
    public int Id { get; set; }
```

   } 

```
class Order {
    public int Id { get; set; }
}
```

If we load an Order as follows:

```
session.Include<Order, Customer>(x => x.Id).Load(1);
```

Then customers/1 will not be included in the response from the server, for reasons unknown. No error is raised, the Include simply has no effect.

I've added a test to check this scenario; it fails, which corresponds to our findings. Regardless of how Raven is supposed to behave in this scenario, I think it'd be good to define it via a test. Personally I'd prefer that this scenario either works or fails with an exception so the client (e.g. our project) isn't left in the dark.
"

b'Current stab looks something like

```
    public class OrderWithProductInformation : AbstractResultsTransformer<Order>
    {
        public class Result
        {
            public string OrderId { get; set; }
            public string ProductId { get; set; }
            public string CustomerId { get; set; }
            public string ProductName { get; set; }
        }
        public OrderWithProductInformation()
        {
            TransformResults = (database, orders) => from doc in orders
                                                     from productid in doc.ProductIds
                                                     let product = database.Load<Product>(productid)
                                                     select new
                                                     {
                                                         OrderId = doc.Id,
                                                         ProductId = product.Id,
                                                         ProductName = product.Name
                                                     };
        }
    }
```

With

```
                var results = session.Query<Order>()
                    .Customize(x => x.WaitForNonStaleResults())
                    .Where(order => order.CustomerId == "customers/bob")
                    .TransformWith<OrderWithProductInformation, OrderWithProductInformation.Result>()
                    .ToList();
```

We can argue over exact semantics once the first test passes - obviously _not ready for merge_
