b"on more than one operate on type. Only passing in Indexes did not work.  We made change to how the OperateOnTypes is parsed. Now it will accept single argument or multiple comma separated arguments.

Comments on Smuggler code changes
Raven.Smuggler/Program.cs

Original - options.OperateOnTypes = (ItemType) Enum.Parse(typeof (ItemType), value);
Modification - options.OperateOnTypes = (ItemType) options.ItemTypeParser(value);

Raven.Abstractions/Smuggler/SmugglerOptions.cs

Added - public ItemType ItemTypeParser(string items)
        {
            var result = new ItemType();
            if (String.IsNullOrWhiteSpace(items))
            {
                return ItemType.Documents | ItemType.Indexes | ItemType.Attachments;
            }
            foreach (var item in items.Split(','))
            {
                result |= (ItemType)Enum.Parse(typeof(ItemType), item);
            }
            return result;
        }

Added new function to correctly pass back the ItemType.

Original - [Flags]
    public enum ItemType
    {
        Documents,
        Indexes,
        Attachments
    }
Modified - [Flags]
    public enum ItemType
    {
        Documents = 0x1,
        Indexes = 0x2,
        Attachments = 0x4
    }

Modified the ItemType to include values necessary for working in .NET.
"

b'Given domain model...

``` c#
public class Entity
{
    public int Id { get; set; }
    public Category Category { get; set; }
}

public class Category
{
    public string Title { get; set; }
}
```

... I want to project results of a select query to this view model:

``` c#
public class EntityViewModel
{
    public int Id { get; set; }
    public string CategoryTitle { get; set; }
}
```

I have tried the following query:

``` c#
var viewModel = (from entity in _documentSession.Query<Entity>()
                select new EntityViewModel
                        {
                            Id = entity.Id,
                            CategoryTitle = entity.Category.Title
                        }.ToList();
```

The result of this is only partially correct: the Id is set, the CategoryTitle is not. 

Is this behaviour by design? Is there, perhaps, an API call I should use for this?

I posted a question on StackOverflow (http://stackoverflow.com/questions/8950182/how-to-handle-projections-in-ravendb), but no answers so far.
'

